const SET_USERS = 'SET_USERS';
const FOLLOW = 'FOLLOW';
const UNFOLLOW = 'UNFOLLOW';

let initialState = {
    users: [
        {id: 1, photoUrl: 'data:image/jpeg;base64,', followed: true, fullName: 'Murad', status: 'I,am a Boss', location: {city: 'Moscow', country: 'Russia'}},
        {id: 2, photoUrl: 'data:image/jpeg;base64,', followed: true, fullName: 'Samir', status: 'I,am a Boss too', location: {city: 'New York', country: 'USA'}},
        {id: 3, photoUrl: 'data:image/jpeg;base64,', followed: false, fullName: 'Sabina', status: 'Lady manager', location: {city: 'Nakhichivan', country: 'Azerbaijan'}},
        {id: 4, photoUrl: 'data:image/jpeg;base64,', followed: false, fullName: 'Khani', status: 'Lady Doctor', location: {city: 'Agdash', country: 'Azerbaijan'}},
    ],
};

const usersReducer = (state = initialState, action) => {

    switch (action.type) {
        case SET_USERS:
            return  {...state, users: [...state.users, ...action.users]}
        case FOLLOW:
            return {
                ...state,
                users: state.users.map(u => {
                    if(u.id === action.userId) {
                        return {...u, followed: true}
                    }
                    return u
                }),
            }

        case UNFOLLOW:
            return {
                ...state,
                users: state.users.map(u => {
                    if(u.id === action.userId) {
                        return {...u, followed: false}
                    }
                    return u
                }),
            }
        default:
            return state;
    }
}

export const setUsersAC = (users) => ({ type: SET_USERS, users })
export const followAC = (userId) => ({ type: FOLLOW, userId })
export const unfollowAC = (userId) => ({ type: UNFOLLOW, userId })

export default usersReducer;